import * as React from "react";
import { Form, Col, Button } from "react-bootstrap";
export default function Header() {
  return (
    <Form>
      <Form.Row>
        <Col>
          <Form.Control placeholder="First name..." />
        </Col>
        <Col>
          <Form.Control placeholder="Last name..." />
        </Col>
        <Col>
          <Button>Submit</Button>
        </Col>
      </Form.Row>
    </Form>
  );
}
